import * as React from 'react';
import { Link, useNavigate } from "react-router-dom";
import Copyright from "./Copyright";

import Alert from '@mui/material/Alert';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Snackbar from '@mui/material/Snackbar';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';



const defaultTheme = createTheme();

export default function Login() {
  const navigate = useNavigate();
  const [rememberMe, setRememberMe] = React.useState(false);
  const [openSnackbar1, setOpenSnackbar1] = React.useState(false);
  const [openSnackbar2, setOpenSnackbar2] = React.useState(false);
  const [snackbarMessage, setSnackbarMessage] = React.useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    const loginData = {
      email: data.get('email'),
      password: data.get('password'),
    };

    try {
      const response = await fetch('http://localhost:5000/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(loginData),
      });

      if(response.ok){
        const data = await response.json();
        console.log('User logged in successfully', data );

        setSnackbarMessage("Successfully Logged In.");
        setOpenSnackbar1(true);

        setTimeout(() => {
          if (data['access_level'] === 'emp') {
            navigate('/employee-dashboard');
          } else if (data['access_level'] === 'cli') {
            navigate('/client-dashboard');
          }
        }, 3000);
      } else {
        const errorData = await response.json();
        console.error('Error:', errorData);
        setSnackbarMessage('Login failed. Please check your credentials.');
        setOpenSnackbar2(true);
      }
    } catch (error) {
      console.error("Error:", error);
      setSnackbarMessage('Network error. Please try again later.');
      setOpenSnackbar2(true);
    };
  };

  const handleRedirect = (page) => {
    navigate(`/${page}`);
  };

  const handleRememberMeChange = (event) => {
    setRememberMe(event.target.checked);
    console.log("Remember me checked:", event.target.checked);
  };

  const handleSnackbarClose = () => {
    setOpenSnackbar1(false);
    setOpenSnackbar2(false);
  };

  return (
    <ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Box
            component="img"
            src="./logo-circle-2.png"
            height="75px"
            sx={{ m: 1 }}
          />
          <Typography component="h1" variant="h5" sx={{ p: 2 }}>
            Sign in
          </Typography>
          <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
            <TextField
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email"
              name="email"
              autoComplete="email"
              autoFocus
            />
            <TextField
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
            />
            <FormControlLabel
              control={<Checkbox value="remember" color="primary" onChange={handleRememberMeChange} />}
              label="Remember me"
            />
            <Button
              type="submit"
              fullWidth
              variant="outlined"
              sx={{ mt: 3, mb: 2 }}
            >
              Sign In
            </Button>
            <Grid container>
              <ButtonGroup>
              <Grid item xs>
                <Button href="/ForgotPassword" variant="text" size="small" onClick={() => handleRedirect("ForgotPassword")}>
                  Forgot password?
                </Button>
              </Grid>
              <Grid item>
                <Button href="/SignUp" variant="text" size="small" onClick={() => handleRedirect("SignUp")}>
                  {"Don't have an account? Sign Up"}
                </Button>
              </Grid>
              </ButtonGroup>
            </Grid>
          </Box>
        </Box>
        <Copyright sx={{ mt: 8, mb: 4 }} />
        <Snackbar open={openSnackbar1} autoHideDuration={6000} onClose={handleSnackbarClose}>
          <Alert onClose={handleSnackbarClose} severity="success" sx={{ width: '100%' }}>
            {snackbarMessage}
          </Alert>
        </Snackbar>  
        <Snackbar open={openSnackbar2} autoHideDuration={6000} onClose={handleSnackbarClose}>
          <Alert onClose={handleSnackbarClose} severity="error" sx={{ width: '100%' }}>
            {snackbarMessage}
          </Alert>
        </Snackbar>  
      </Container>
    </ThemeProvider>
  );
}
